function jac = jacobian(t, xxxxx, par_a, par_b, par_c)
jac = reshape([[par_a*xxxxx(2)*cos(par_a*xxxxx(1)*xxxxx(2)), par_a*xxxxx(1)*cos(par_a*xxxxx(1)*xxxxx(2))], [2*par_b*xxxxx(1)*xxxxx(2)*cos(par_b*xxxxx(1)^2*xxxxx(2)), par_b*xxxxx(1)^2*cos(par_b*xxxxx(1)^2*xxxxx(2))]],2,2);
