jacp = reshape([[xxxxx(1)*xxxxx(2)*cos(par_a*xxxxx(1)*xxxxx(2)), 0, 0], [0, xxxxx(1)^2*xxxxx(2)*cos(par_b*xxxxx(1)^2*xxxxx(2)), 0]],2,3);
